//[奇遇][装备商人]随机物品库package cn.mxz;public class EquipmentMerchantTemplet {	/** 	 * 唯一ID 	 */	private int idfen;	/** 	 * 物品id 	 */	private int equipmentTempletId;	/** 	 * 道具名稱 	 */	private String propNeame;	/** 	 * 品階 	 */	private int step;	/** 	 * 權重 	 */	private int weight;	/** 	 * 單次兌換獲得數量 	 */	private int number;	/** 	 * 限兌次數 	 */	private int quota;	/** 	 * 兌換所需消耗 	 */	private String consume;	/**	 * 唯一ID	 */	void setIdfen(int idfen) {		this.idfen = idfen;	}	/**	 * 唯一ID	 */	public int getIdfen() {		return this.idfen;	}	/**	 * 物品id	 */	void setEquipmentTempletId(int equipmentTempletId) {		this.equipmentTempletId = equipmentTempletId;	}	/**	 * 物品id	 */	public int getEquipmentTempletId() {		return this.equipmentTempletId;	}	/**	 * 道具名稱	 */	void setPropNeame(String propNeame) {		this.propNeame = propNeame;	}	/**	 * 道具名稱	 */	public String getPropNeame() {		return this.propNeame;	}	/**	 * 品階	 */	void setStep(int step) {		this.step = step;	}	/**	 * 品階	 */	public int getStep() {		return this.step;	}	/**	 * 權重	 */	void setWeight(int weight) {		this.weight = weight;	}	/**	 * 權重	 */	public int getWeight() {		return this.weight;	}	/**	 * 單次兌換獲得數量	 */	void setNumber(int number) {		this.number = number;	}	/**	 * 單次兌換獲得數量	 */	public int getNumber() {		return this.number;	}	/**	 * 限兌次數	 */	void setQuota(int quota) {		this.quota = quota;	}	/**	 * 限兌次數	 */	public int getQuota() {		return this.quota;	}	/**	 * 兌換所需消耗	 */	void setConsume(String consume) {		this.consume = consume;	}	/**	 * 兌換所需消耗	 */	public String getConsume() {		return this.consume;	}}